import React , { useState } from 'react';
import {  Button,TextField,Select,FormControl} from '@mui/material';
import { styled } from '@mui/material/styles';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem'; 
import axios from 'axios';

import GuardDashboard from "./GuardDashboard";

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${tableCellClasses.head}`]: {
    backgroundColor: "#e3f2fd",
    color: theme.palette.common.black,
    fontSize: 20,
  },
  [`&.${tableCellClasses.body}`]: {
    fontSize: 20,
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  "&:nth-of-type(odd)": {
    backgroundColor: theme.palette.action.hover,
  },
  // hide last border
  "&:last-child td, &:last-child th": {
    border: 0,
  },
}));

function GuardAddOrderPage() {
  function createData(orderid, firstname, lastname, retailer) {
    return {
      OrderID: orderid,
      FirstName: firstname,
      LastName: lastname,
      DateOfDelivery: new Date().toISOString().slice(0, 10),
      Retailer: retailer,
    };
  }
  const [inputField, setInputFields] = useState([
    { orderid: "", firstname: "", lastname: "", retailer: "" },
  ]);

  const handleFormChange = (index, e) => {
    let data = [...inputField];
    data[index][e.target.name] = e.target.value;
    setInputFields(data);
    console.log(data);
  };

  const handleSubmit = (e) => {
    // e.preventDefault();
    const dataToSend = inputField.map((field) =>
      createData(field.orderid, field.firstname, field.lastname, field.retailer)
    );
    console.log(dataToSend);
    const response = axios.post(
      `http://localhost:9003/order/saveorderdata`,
      dataToSend
    );
  };

  const addFields = (event) => {
    event.preventDefault();
    let newField = { orderid: "", firstname: "", lastname: "", retailer: "" };
    setInputFields([...inputField, newField]);
  };

  return (
    <>
      <GuardDashboard />
      <Paper
        elevation={16}
        sx={{ marginTop: "60px", marginLeft: "30px", marginRight: "30px" }}
      >
        <TableContainer component={Paper}>
          <Table
            component="form"
            // onSubmit={handleSubmit}
            sx={{ minWidth: 700 }}
            aria-label="customized table"
          >
            <TableHead>
              <TableRow>
                <StyledTableCell align="center">Order Id</StyledTableCell>
                <StyledTableCell align="center">First Name</StyledTableCell>
                <StyledTableCell align="center">Last Name</StyledTableCell>
                <StyledTableCell align="center">Retailer</StyledTableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {inputField.map((input, index) => (
                <StyledTableRow key={index.name}>
                  <StyledTableCell>
                    <TextField
                      variant="outlined"
                      required
                      fullWidth
                      label="Order Id"
                      name="orderid"
                      value={input.orderid}
                      onChange={(e) => handleFormChange(index, e)}
                    />
                  </StyledTableCell>
                  <StyledTableCell>
                    <TextField
                      variant="outlined"
                      required
                      fullWidth
                      label="First Name"
                      name="firstname"
                      value={input.firstname}
                      onChange={(e) => handleFormChange(index, e)}
                    />
                  </StyledTableCell>
                  <StyledTableCell>
                    <TextField
                      variant="outlined"
                      fullWidth
                      label="Last Name"
                      name="lastname"
                      value={input.lastname}
                      onChange={(e) => handleFormChange(index, e)}
                    />
                  </StyledTableCell>
                  <StyledTableCell>
                    <TextField
                      variant="outlined"
                      required
                      fullWidth
                      label="Retailer"
                      name="retailer"
                      value={input.retailer}
                      onChange={(e) => handleFormChange(index, e)}
                    />
                  </StyledTableCell>
                </StyledTableRow>
              ))}
            </TableBody>
            <Button
              sx={{ backgroundColor: "#e3f2fd", mt: 1, color: "#0d47a1" }}
              type="submit"
              fullWidth
              variant="outline"
              // sx={{ mt: 1}}
              onClick={addFields}
            >
              Add more +
            </Button>

          </Table>
          <Button
              onClick={handleSubmit}
              fullWidth
              variant="outline"
              sx={{
                marginTop: "20px",
                backgroundColor: "#e3f2fd",
                mt: 1,
                color: "#0d47a1",
              }}
            >
              Submit Details
            </Button>

        </TableContainer>
        </Paper> 
    </>
  );
}

export default GuardAddOrderPage;
